import datetime
start = datetime.datetime.now()
#(10 ** (len(str(num)) - 1)))
def digitos(n):
    dig = []
    num = n
    for i in range(len(str(n))):
        dig.insert(0, num % 10)
        num = num // 10

    return dig

def multiple(t, m):
    l = digitos(t)
    great = [0]
    for i in range(len(l) - m):
        inter = 1
        sequence = ""
        for k in range(m):
            inter *= l[i + k]
            sequence += str(l[i + k]) 
        if inter > great[0]:
            great = [inter, sequence]
    for e in great:
        print(e)


